*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    font-family: 'Montserrat', sans-serif;
}

li{
    text-decoration: none;
}
a.navbar-brand{
    font-weight: 700;
    font-size: 26px;
    color: #0921FF;
}
div.navbar-nav a {
    font-weight: 700;
    color: black;
    font-size: 13px;
}
#whatsapp{
    font-weight: 700;
    border-radius: 6px;
    font-size: 13px;
    background-color: #0921FF;
}
#evo{
    margin-top: 80px;
    margin-left: 20px;
    font-weight: 700;
}
#mondelly{
    margin-left: 20px;
    margin-top: -20px;
    color: #0921FF;
    font-weight: 700;
}
